import React from "react";
import { baseURL } from "../global";

const pkm = {
    "owner_id": 1,
    "pokemonName": "magikarp",
    "nickName": "magikarp",
    "level": 5,
    "IV": {"hp": 20,"atk": 13,"def": 10,"spa": 21,"spd": 1,"spe": 27},
    "nature": "timid",
    "moves": [],
    "stats": {"hp": 19,"atk": 6,"def": 12,"spa": 8,"spd": 8,"spe":16}
}


class PokemonCard extends React.Component {
    constructor (props) {
        super(props)
    }

    render() {
        return(
            <div className="card">
                {/* <Link to={{
                    pathname: '/pokemonInfo',
                    state: {
                    test: this.props.pokemon,

                    }
                }}>
                    <img src={this.props.recipe.image} alt="image_source" />
                    <h4 className="card-title">{this.props.pokemon}</h4>
                </Link> */}
                <img src={baseURL + "/v1/pokedex/image/" + this.props.pokemonName} alt={this.props.pokemonName + " image"} />
                <h4 className="card-title">{this.props.pokemonName}</h4>
                <p>{"level: " + this.props.level}</p>
                <p>{"nature: " + this.props.nature}</p>

            </div>
        );
    }
}

export default PokemonCard;
